script: |
  super -f text -I q13761.spq | sort > q13761.out

inputs:
  - name: q13761.spq
    data: |
      SELECT ALL - + col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col0 NOT BETWEEN + col1 * col0 AND + - 79;
  - name: tab0

outputs:
  - name: q13761.out
    data: |
      -1
      -21
      -81
